/** @format */

import React from 'react';
import { connect } from 'react-redux';
import { AppState } from '../../redux/root.reducer';
import { SectionDetailType } from '../../redux/dictionary/dictionary.types';

interface HomePageProps {
	id?: number;
}
interface HomePageState {}

type Props = HomePageProps & HomePageState & LinkStateProps;

export const Directory: React.FC<Props> = (props) => {
	const { sections } = props;
	console.log(sections);

	return (
		<>
			<div className='collection-container'>
				{sections.map((section, indx) => (
					<Collection key={section.id} collection={section} />
				))}
			</div>
		</>
	);
};

interface LinkStateProps {
	sections?: SectionDetailType[];
}

const mapStateToProps = (
	state: AppState,
	ownProps: HomePageProps,
): LinkStateProps => ({
	sections: state.sections,
});

export default connect(mapStateToProps, null)(Directory);
